import React, { useState } from "react";
import { useHistory } from "react-router-dom";
import PropTypes from 'prop-types';

function SignUp({ }) {

    return(
        <div className="login-wrapper">
            <h1>Please Log In</h1>
            <form>
                <label>
                    <p>Username</p>
                    <input type="text" />
                </label>
                <label>
                    <p>Password</p>
                    <input type="password" />
                </label>
                <div>
                    <button type="submit">Submit</button>
                </div>
            </form>
        </div>
    );
};

export default SignUp;
